import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import './App.css';

import NavBar from './components/NavBar/NavBar';

import Map from './components/Map/Map';
import Home from './pages/Home/Home';
import Church from './pages/Church/Church';

  export default function App() {
    return (
      <Router>
        <React.Fragment>
          <NavBar />
          <Switch>
            <Route path="/" exact component={Home} />
            <Route path="/churches" component={Church} />
          </Switch>
          <div className="App-header">
            <div style = {{ width: "80vw", height: "80vh"}}>
              <Map 
                googleMapURL={`https://maps.googleapis.com/maps/api/js?v=3.exp&libraries=geometry,drawing,places&key=AIzaSyASigF8g5y-u4pWOqF41qMmiF2gWBQCUVw`}
                loadingElement={<div style={{ height: "100%" }} /> }
                containerElement={<div style={{ height: "100%" }} /> }
                mapElement={<div style={{ height: "100%" }} /> }
              />
            </div>
          </div>
        </React.Fragment>
      </Router>
    );
  }
